{"first_name": "Tuy\u1ebfn", "meaning": "\"Tuy\u1ebfn\" \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 ranh gi\u1edbi, bi\u00ean gi\u1edbi, h\u00e0m ch\u1ec9 s\u1ef1 r\u00f5 r\u00e0ng, r\u00e0nh m\u1ea1ch. Ng\u01b0\u1eddi t\u00ean Tuy\u1ebfn th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u00ednh t\u00ecnh ngay th\u1eb3ng, th\u1eadt th\u00e0, hi\u1ec3u bi\u1ebft, ph\u00e2n bi\u1ec7t \u0111\u01b0\u1ee3c t\u1ed1t x\u1ea5u, \u0111\u00fang sai", "sex": 7}
{"first_name": "Tuy\u1ec1n", "meaning": "\"Tuy\u1ec1n\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 d\u00f2ng su\u1ed1i, ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 t\u00ednh c\u00e1ch trong s\u1ea1ch, \u0111i\u1ec1m \u0111\u1ea1m, lu\u00f4n tinh th\u1ea7n b\u00ecnh t\u0129nh, th\u00e1i \u0111\u1ed9 an nhi\u00ean tr\u01b0\u1edbc m\u1ecdi bi\u1ebfn c\u1ed1 c\u1ee7a cu\u1ed9c \u0111\u1eddi", "sex": 5}
{"first_name": "Tuy\u1ec3n", "meaning": "Ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ch\u1ecdn l\u1ef1a, th\u1ec3 hi\u1ec7n th\u00e1i \u0111\u1ed9 c\u1ea7u th\u1ecb, k\u1ef9 l\u01b0\u1ee1ng, nghi\u00eam t\u00fac, c\u00f3 tr\u00e1ch nhi\u1ec7m", "sex": 3}
{"first_name": "Tuy\u1ebft", "meaning": "L\u00e0 ng\u01b0\u1eddi h\u00f2a nh\u00e3, \u0111a t\u00e0i, xinh \u0111\u1eb9p, trong tr\u1eafng nh\u01b0 tuy\u1ebft", "sex": 5}
{"first_name": "Tuy\u1ebft\u00a0", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Tuy\u1ebft\" l\u00e0 tinh th\u1ec3 b\u0103ng nh\u1ecf v\u00e0 tr\u1eafng k\u1ebft tinh th\u00e0nh kh\u1ed1i x\u1ed1p, nh\u1eb9, r\u01a1i \u1edf v\u00f9ng c\u00f3 kh\u00ed h\u1eadu l\u1ea1nh. T\u00ean \"Tuy\u1ebft\" g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, trong tr\u1eafng, tinh kh\u00f4i, thanh cao v\u00e0 quy\u1ec1n qu\u00fd nh\u01b0 nh\u1eefng b\u00f4ng hoa tuy\u1ebft.", "sex": 5}
{"first_name": "Ty", "meaning": "Ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 s\u1ee3i t\u01a1 nh\u1ecf b\u00e9, m\u1ea3nh mai, d\u00f9ng \u0111\u1ec3 ch\u1ec9 s\u1ef1 m\u1ec1m m\u1ea1i d\u1ecbu d\u00e0ng, uy\u1ec3n chuy\u1ec3n \u0111\u1eb9p \u0111\u1ebd.", "sex": 5}
{"first_name": "T\u00fd", "meaning": "Ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 che ch\u1edf, \u00fd ch\u1ec9 con ng\u01b0\u1eddi c\u00f3 tr\u00e1ch nhi\u1ec7m, quan t\u00e2m k\u1ebb kh\u00e1c, bi\u1ebft chia s\u1ebb g\u00e1nh v\u00e1c.", "sex": 3}
